import React from 'react';

import PreviewCollection from '../preview-collection/preview.colletion.component'

class ShopList extends React.Component {
    constructor(props){
        super(props);
        this.state = {
            collections: [],
            sections: [
                {
                  title: 'hats',
                  imageUrl: 'https://i.ibb.co/cvpntL1/hats.png',
                  id: 1,
                  linkUrl: 'hats'
                },
                {
                  title: 'jackets',
                  imageUrl: 'https://i.ibb.co/px2tCc3/jackets.png',
                  id: 2,
                  linkUrl: ''
                },
                {
                  title: 'sneakers',
                  imageUrl: 'https://i.ibb.co/0jqHpnp/sneakers.png',
                  id: 3,
                  linkUrl: ''
                },
                {
                  title: 'womens',
                  imageUrl: 'https://i.ibb.co/GCCdy8t/womens.png',
                  size: 'large',
                  id: 4,
                  linkUrl: ''
                },
                {
                  title: 'mens',
                  imageUrl: 'https://i.ibb.co/R70vBrQ/men.png',
                  size: 'large',
                  id: 5,
                  linkUrl: ''
                }
              ]
        }

    }

    componentDidMount = async() => {
        try {
            const getDataB = await fetch('http://localhost:3000/shop')
            const dataToJ = await getDataB.json()
            this.setState({collections: dataToJ},console.log(dataToJ))
        }
        catch(err){
            console.log('not possible now');
        }
    }


    render(){


        return(
            <div>
                <div>Ramen</div>
                <div>shop page</div>
                {this.state.collections.map(({id, ...otherCollection}) => (
                        <PreviewCollection id={id} {...otherCollection} />
                    ))}
            </div>
        )
    }

}

export default ShopList
